import {useState} from 'react';
import axios from 'axios';
import {Link} from 'react-router-dom';
import {BrowserRouter as Router} from 'react-router-dom';
import {Routes as Routes} from 'react-router-dom';
import {Route as Route} from 'react-router-dom';
import Contact from './Contact';
import About from './About';

function Home(){
  const [stvar, setMess] = useState('');
  const handleClick = () => {
    axios.get('http://localhost:8080/helphealth12')
    .then(response => setMess(response.data))
  }
  const linksData = [
    { id: 1, text: 'Home', to: '/' },
    { id: 2, text: 'About', to: '/about' },
    { id: 3, text: 'Contact', to: '/contact' },
    ];
    return(
            <div>
                <h1>Welcome to localhost:3000</h1>
                <p>You are currently communicating with localhost:8080.</p>
                <Routes>
                    <Route path="/" element={<Home />} />
                    <Route path="/about" element={<About name = {stvar}/>} />
                    <Route path="/contact" element={<Contact name = {stvar}/>} />
                </Routes>
                <nav>
                    <ul>
                        {linksData.map((link) => (
                        <li key={link.id}>
                            <Link to={link.to} onClick = {handleClick}>{link.text}</Link>
                        </li>
                        ))}
                    </ul>
                </nav>
            </div>
    )
}

export default Home;
